function App() {
   axios({
     url:"http://localhost:5000/api/allassets",
     method:"get",
     data:{}
   }).then((response)=>{
     console.log(".....",response.data)
   },(error)=>{
     console.log("...",error)
   })



  return (
    <div className="NavBar">


    <nav class="navbar navbar-expand-lg navbar-light bg-light">
<Link to="/"> <a class="navbar-brand" href="#">Stream Video </a> </Link>
<button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
<span class="navbar-toggler-icon"></span>
</button>

<div class="collapse navbar-collapse" id="navbarSupportedContent">
<ul class="navbar-nav mr-auto">
  <li class="nav-item active">
   <a class="nav-link" href="#">Welcome <span class="sr-only">(current)</span></a>  
  </li>



</ul>
<form class="form-inline my-2 my-lg-0">
  <input class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" onChange={getText}/>
 <Link to={'/search/search?cakes='+serchText}>
   <div> <Icon.Search  className="mr-2" size={25} /> 
   </div>
   </Link> 


  {props.islogin ?
  <div>
    <Link to={'/cart'}> <Icon.Cart2 className="mr-2" size={30}/><span class="badge badge-light" style={{color:"black",fontSize:"15px"}}>{props.cart?.length}</span></Link>
  <button onClick={onLogout} className="btn btn-danger mr-1">Logout</button> </div>:<Link to="/login"><button  className="btn btn-primary mr-1">Login</button></Link>}

</form>
</div>
</nav>
  </div>
  );
}

export default App;
